import React from 'react';
import Link from 'react-router-dom';

const Mechanics = () => (
  <div>
    <h2>time</h2>
    <h2>space</h2>
    <h2>chance</h2>
    <Link to='/'>Home</Link>
  </div>
);

export default Mechanics;
